(function() {

  /**
   * @description 
   * @param {Object} obj 
   * @param {Object} query 
   * @param {Boolean} all 
   * @return {Boolean} truefalse
   */
  function as(obj, query, all) {
    if (obj) {
      var bl = true;
      var type = typeof(obj);
      if (type !== typeof(query)) {
        //  
        bl = false;
      } else if (type === 'string' || type === 'bool' || type === 'number') {
        bl = obj === query;
      } else if (obj.constructor == Array) {
        // 
        var lh = obj.length;
        if (all && lh !== query.length) {
          //   
          bl = false;
        } else {
          // 
          for (var i = 0; i < lh; i++) {
            if (!as(obj[i], query[i])) {
              bl = false;
              break;
            }
          }
        }
      } else {
        // 
        if (all && Object.getOwnPropertyNames(obj).length !== Object.getOwnPropertyNames(query).length) {
          // , 
          bl = false;
        } else {
          // 
          for (var k in query) {
            if (!as(obj[k], query[k], all)) {
              bl = false;
              break;
            }
          }
        }
      }
      return bl;
    } else {
      return false;
    }
  }

	/**
	 * 
	 * @param {Array} list 
	 * @param {String} id ID
	 * @param {Number} value ID
	 * @param {String} father_id ID
	 * @param {String} sub 
	 * @return {Array} 
	 */
	function toTree(list, id, value = 0, father_id = 'father_id', sub = 'sub') {
		var arr = [];
		for (var i = 0; i < list.length; i++) {
			var o = list[i];
			if (o[father_id] === value) {
				o[sub] = toTree(list, id, o[id], father_id, sub);
				arr.push(o);
			}
		}
		return arr;
	}

	function toList(list, sub = 'sub', arr = []) {
		for (var i = 0; i < list.length; i++) {
			var o = list[i];
			var lt = o[sub];
			delete o[sub];
			arr.push(o);
			if (lt && lt.length > 0) {
				toList(lt, sub, arr);
			}
		}
		return arr;
	}

	/**
	 * 
	 * @param {String} id ID
	 * @param {Number} value ID
	 * @param {String} father_id ID
	 * @param {String} sub 
	 * @return {Array} 
	 */
	Array.prototype.toTree = function(id, value = 0, father_id = 'father_id', sub = 'sub') {
		return toTree(this, id, value, father_id, sub);
	};

	/**
	 * 
	 * @param {String} sub 
	 * @param {Array} arr 
	 * @return {Array} 
	 */
	Array.prototype.toList = function(sub = 'sub', arr = []) {
		return toList(this, sub, arr);
	};

	/**
	 * @description 
	 * @param {Boolean} has 
	 * @return {Array} 
	 */
	Array.prototype.copy = function(has) {
		var arr_new = [];
		var arr = this;
		if (has) {
			for (var i = 0; i < arr.length; i++) {
				var o = arr[i];
				if (o) {
					arr_new[i] = o;
				}
			}
		} else {
			for (var i = 0; i < arr.length; i++) {
				arr_new[i] = arr[i];
			}
		}
		return arr_new;
	};
	/**
	 * @description 
	 * @param {Function(Object):Boolean} func 
	 */
	Array.prototype.func = function(func) {
		for (var i = 0; i < this.length; i++) {
			if (func(this[i])) {
				break;
			}
		}
	};
	/**
	 * @description 
	 * @param {String} splitStr 
	 * @param {String} key 
	 * @return {String} 
	 */
	Array.prototype.toStr = function(splitStr, key) {
		var arr = this;
		var str = "";
		if (key) {
			for (var i = 0; i < arr.length; i++) {
				var o = arr[i];
				if (o[key]) {
					str += splitStr + o[key];
				}
			}
		} else {
			for (var i = 0; i < arr.length; i++) {
				var o = arr[i];
				str += splitStr + o;
			}
		}
		return str.replace(splitStr, "");
	};
	/**
	 * @description 
	 * @return {Array} 
	 */
	Array.prototype.clear = function() {
		this.splice(0, this.length);
		return this;
	};
	/**
	 * @description 
	 * @param {Object} query 
	 * @param {Object} obj 
	 * @return {Array} 
	 */
	Array.prototype.set = function(query, obj) {
		for (var i = 0; i < this.length; i++) {
			var o = this[i];
			for (var k in query) {
				if (as(o, query)) {
					this[i] = obj;
				};
			}
		}
		return this;
	};

	/**
	 * @description 
	 * @param {String} key 
	 * @return {Array} 
	 */
	Array.prototype.toArr = function(key) {
		var arr = [];
		var lt = this;
		var len = lt.length;
		for (var i = 0; i < len; i++) {
			var o = lt[i];
			arr.push(o[key]);
		}
		return arr;
	};

	/**
	 * @description 
	 * @param {Object} query 
	 * @param {Boolean} end 
	 * @return {Object} 
	 */
	Array.prototype.get = function(query, end) {
		if (query) {
			if (end) {
				var obj;
				for (var i = 0; i < this.length; i++) {
					var o = this[i];
					if (as(o, query)) {
						obj = o;
						break;
					}
				}
				return obj;
			} else {
				var list = [];
				for (var i = 0; i < this.length; i++) {
					var o = this[i];
					if (as(o, query)) {
						list.push(o);
					}
				}
				return list;
			}
		} else {
			var list = [];
			list.addList(this);
			return list;
		}
	};

	/**
	 * @description 
	 * @param {Object} query 
	 * @return {Object} 
	 */
	Array.prototype.getObj = function(query) {
		var obj;
		if (query) {
			for (var i = 0; i < this.length; i++) {
				var o = this[i];
				if (as(o, query)) {
					obj = o;
					break;
				}
			}
		}
		return obj;
	};
	/**
	 * @description 
